import {Dialog, withStyles, Box, Typography, makeStyles} from '@material-ui/core';
import '../../index.css'

const useStyles = makeStyles({
    component: {

    },
    leftComponent: {

    }
})

const style = {
    dialogPaper: {
        height: '95%',
        width: '60%',
        marginTop: '12%'
    }
}

const Login = ({classes}) => {
    const classname = useStyles();
    return(
        <Dialog
           open={true}
           classes={{paper: classes.dialogPaper}}
           BackdropProps={{style: {backgroundColor: 'unset'}}}
        >
        <Box>
            <Box class="App">
                <Typography>Autenticação de Usuário</Typography>
            </Box>
            <Box>

            </Box>
        </Box>
        <h1 class="App">Autenticação de Usuário</h1>
        <div class="form-control App">
		    <label for="room">Informe quem é você: </label>
		    <select name="room" id="room">
		    	<option value="Sales">Consumidor</option>
		    	<option value="Sales">Segurador/Corretor</option>
		    	<option value="Sales">Lojista/Oficina</option>
		    	<option value="Delivery">Vendedor/ Atendente Autoglass</option>
		    </select>
		</div>
        </Dialog>
    )
}

export default withStyles(style)(Login);
